using Newtonsoft.Json.Linq;using System;using System.Collections.Generic;using System.Linq;using System.Web;namespace CanIGoOutside.Models{    public class PostalCode    {        public PostalCode(string json)        {            if (json != null)            {                JArray jsonArray = JArray.Parse(json);                if (jsonArray != null)                {                    dynamic data = JObject.Parse(jsonArray[0].ToString());                    Key = data.Key;                }            }        }        public string Key { get; set; }    }}